import React, { useState } from "react";
import "./Workplace.css";
import { Link, useHistory } from "react-router-dom";
import Workspace_list from "./Workspace_list";
import Header from "./Header";
import add from "../assets/add.svg";
import bug from "../assets/bug.svg";
import app from "../assets/app.svg";
import share from "../assets/share.svg";
import dlt from "../assets/dlt.svg";
import rename from "../assets/rename.svg";
import settings from "../assets/settings.svg";

import arrow from "../assets/arrow.svg";
import add_circle from "../assets/add_circle.svg";
import {
    Pane,
    DragHandleVerticalIcon,
    Popover,
    Menu,
    TextInputField,
    TextInput,
    Dialog,
    SelectMenu,
    Avatar,
    MoreIcon,
    Position,
    CrossIcon,
    TickIcon,
} from "evergreen-ui";
import avatar from "../assets/avatar.jpg";
import avatar1 from "../assets/avatar1.jpeg";
import avatar2 from "../assets/avatar2.jpeg";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";
import clock from "../assets/clock.png";

const finalSpaceCharacters = [
    {
        id: "Bug Tracking",
        name: "Bug Tracking",
        progress: "72%",
        day: "7 days left",
        collaborators: "+8",
        thumb: bug,
    },
    {
        id: "App Development",
        name: "App Development",
        progress: "58%",
        day: "3 days left",
        collaborators: "+6",
        thumb: app,
    },
    {
        id: "Bug Tracking1",
        name: "Bug Tracking1",
        progress: "72%",
        day: "7 days left",
        collaborators: "+8",
        thumb: bug,
    },
    {
        id: "App Development1",
        name: "App Development1",
        progress: "58%",
        day: "3 days left",
        collaborators: "+6",
        thumb: app,
    },
];
const finalSpaceCharacters1 = [
    {
        id: "Bug Tracking",
        name: "Bug Tracking",
        progress: "72%",
        day: "7 days left",
        collaborators: "+8",
        thumb: bug,
    },
    {
        id: "App Development",
        name: "App Development",
        progress: "58%",
        day: "3 days left",
        collaborators: "+6",
        thumb: app,
    },
];

function Workplace() {
    const [characters, updateCharacters] = useState(finalSpaceCharacters);
    const [characters1, updateCharacters1] = useState(finalSpaceCharacters1);

    function handleOnDragEnd(result) {
        if (!result.destination) return;

        const items = Array.from(characters);
        const [reorderedItem] = items.splice(result.source.index, 1);
        items.splice(result.destination.index, 0, reorderedItem);

        updateCharacters(items);
    }
    function handleOnDragEnd1(result) {
        if (!result.destination) return;
        const items = Array.from(characters1);
        const [reorderedItem] = items.splice(result.source.index, 1);
        items.splice(result.destination.index, 0, reorderedItem);

        updateCharacters1(items);
    }
    let history = useHistory();

    const [selected, setSelected] = React.useState(null);
    const [selected1, setSelected1] = React.useState(null);
    const [isShown, setIsShown] = React.useState(false);
    const [isShown1, setIsShown1] = React.useState(false);
    const [isShown2, setIsShown2] = React.useState(false);
    const [isShown3, setIsShown3] = React.useState(false);
    const [selectedTab, setSelectedTab] = React.useState(false);

    const menu = {
        height: "30px",
    };
    const containerStyles = {
        height: 3.5,
        width: "100%",
        backgroundColor: "#dfe1ef",
        borderRadius: "10px",
        marginTop: -3,
    };

    const fillerStyles = {
        height: "100%",
        width: "72%",
        backgroundColor: "#272727",
        borderRadius: "inherit",
        textAlign: "right",
    };

    const textinput = {
        height: "40px",
        border: "solid 0.1px rgba(112,112,112,0.1",
        color: "#9a9a9a",
    };
    const more_home = {
        /* background-color: brown; */
        color: "#cecece",
        cursor: "pointer",
        float: "right",
        marginLeft: "50px",
        marginTop: "1px",
        marginRight: "5px",
        width: "13px",
        height: "13px",
        // visibility: "hidden",
    };

    return (
        <div>
            <Header />
            <Workspace_list />
            <div className="cotainer">
                <Pane className="workspace_container">
                    <div>
                        <h2>My First Workspace</h2>
                        <Popover
                            position={Position.BOTTOM_LEFT}
                            minWidth={120}
                            content={
                                <Menu>
                                    <Menu.Group>
                                        <Menu.Item style={menu} icon={<Avatar src={settings} shape="square" size={10} />}>
                                            <p className="menucontent">Workspace settings</p>
                                        </Menu.Item>
                                        <Menu.Item
                                            onSelect={() => setIsShown(true)}
                                            style={menu}
                                            icon={<img src={share} alt="" height="10" width="10" />}
                                        >
                                            <p className="menucontent">Share workspace</p>
                                        </Menu.Item>
                                        <Menu.Item
                                            onSelect={() => setIsShown3(true)}
                                            style={menu}
                                            icon={<img src={rename} alt="" height="10" width="10" />}
                                        >
                                            <p className="menucontent">Rename workspace</p>
                                        </Menu.Item>
                                        <Menu.Item
                                            onClick={() => setIsShown1(true)}
                                            style={menu}
                                            icon={<img src={dlt} alt="" height="10" width="10" />}
                                        >
                                            <p className="menucontent">Delete workspace</p>
                                        </Menu.Item>
                                    </Menu.Group>
                                </Menu>
                            }
                        >
                            <img src={arrow} alt="" className="arrow" />
                        </Popover>

                        <Dialog
                            margin="none"
                            padding="none"
                            topOffset={220}
                            width={465}
                            minHeightContent={205}
                            onCloseComplete={() => setIsShown3(false)}
                            preventBodyScrolling
                            hasHeader={false}
                            isShown={isShown3}
                            hasFooter={false}
                        >
                            <div className="rename_workspace">
                                <h4>Change App Development to</h4>
                                <p>Change your space name to another</p>
                                <TextInput
                                    marginLeft="-5px"
                                    marginRight="-20px"
                                    className="new_name"
                                    borderRadius="none"
                                    width={420}
                                    height={31}
                                    placeholder="Enter new name"
                                />
                                <div>
                                    <button className="renamecancel_btn move" onClick={() => setIsShown3(false)}>
                                        Cancel
                                    </button>
                                    <button className="move_btn" onClick={() => setIsShown3(false)}>
                                        Save
                                    </button>
                                </div>
                            </div>
                        </Dialog>
                        <Dialog
                            margin="none"
                            padding="none"
                            topOffset={220}
                            width={465}
                            minHeightContent={205}
                            onCloseComplete={() => setIsShown2(false)}
                            preventBodyScrolling
                            hasHeader={false}
                            isShown={isShown2}
                            hasFooter={false}
                        >
                            <div className="rename_workspace">
                                <h4>Move My First workplace to another workspace</h4>
                                <p>Choose workspace</p>

                                <SelectMenu
                                    height={140}
                                    width={400}
                                    title="My second workspace"
                                    options={[
                                        "My first workspace",
                                        "My second workspace",
                                        "My third workspace",
                                        "My fourth workspace",
                                    ].map((label) => ({
                                        label,
                                        value: label,
                                    }))}
                                    selected={selected1}
                                    closeOnSelect={true}
                                    hasFilter={false}
                                    hasTitle={false}
                                    onSelect={(item) => setSelected1(item.value)}
                                >
                                    <button className="dropdwn">
                                        {selected1 || "My second workspace"}
                                        <img src={arrow} className="drop_icon_pro" alt="" height="8" width="15" />
                                    </button>
                                </SelectMenu>

                                <div>
                                    <button className="cancel_btn move" onClick={() => setIsShown2(false)}>
                                        Cancel
                                    </button>
                                    <button className="move_btn" onClick={() => setIsShown2(false)} s>
                                        Move
                                    </button>
                                </div>
                            </div>
                        </Dialog>
                        <Dialog
                            margin="none"
                            padding="none"
                            topOffset={170}
                            width={465}
                            minHeightContent={305}
                            onCloseComplete={() => setIsShown(false)}
                            preventBodyScrolling
                            hasHeader={false}
                            isShown={isShown}
                            hasFooter={false}
                        >
                            <div className="share_workspace">
                                <h4>Add your teammates to deski Software</h4>
                                <p>
                                    People you add will receive an invite automatically or after your site admin has
                                    approved the request.
                                </p>
                                <TextInputField
                                    width={400}
                                    style={textinput}
                                    className="share_input"
                                    placeholder="Type name, group or email address"
                                />
                                <SelectMenu
                                    height={140}
                                    width={400}
                                    title="Select name"
                                    options={["Collaborator", "Admin", "Viewer", "Administrator"].map((label) => ({
                                        label,
                                        value: label,
                                    }))}
                                    selected={selected}
                                    closeOnSelect={true}
                                    hasFilter={false}
                                    hasTitle={false}
                                    onSelect={(item) => setSelected(item.value)}
                                >
                                    <button className="dropdown">
                                        {selected || "Administrator"}
                                        <img src={arrow} className="drop_icon" alt="" height="8" width="15" />
                                    </button>
                                </SelectMenu>

                                <div>
                                    <button className="cancel_btn" onClick={() => setIsShown(false)}>
                                        Cancel
                                    </button>
                                    <button className="add_btn" onClick={() => setIsShown(false)} s>
                                        Add
                                    </button>
                                </div>
                            </div>
                        </Dialog>
                    </div>
                    <div>
                        <DragDropContext onDragEnd={handleOnDragEnd}>
                            <Droppable droppableId="characters" direction="horizontal">
                                {(provided) => (
                                    <div
                                        className="characters card_drag"
                                        {...provided.droppableProps}
                                        ref={provided.innerRef}
                                    >
                                        {characters.map(({ id, name, progress, day, collaborators, thumb }, index) => {
                                            return (
                                                <Draggable key={id} draggableId={id} index={index}>
                                                    {(provided) => (
                                                        <Pane
                                                            className="space"
                                                            onClick={() => {
                                                                history.push("/board");
                                                            }}
                                                            ref={provided.innerRef}
                                                            {...provided.draggableProps}
                                                        >
                                                            <div {...provided.dragHandleProps}>
                                                                <DragHandleVerticalIcon className="card_dragicon" />
                                                                <Popover
                                                                    position={Position.BOTTOM_LEFT}
                                                                    minWidth={50}
                                                                    content={
                                                                        <Menu>
                                                                            <Menu.Group>
                                                                                <Menu.Item
                                                                                    onSelect={() => setIsShown3(true)}
                                                                                    style={menu}
                                                                                >
                                                                                    <p className="menucontent">
                                                                                        Rename space
                                                                                    </p>
                                                                                </Menu.Item>
                                                                                <Menu.Item
                                                                                    onSelect={() => setIsShown(true)}
                                                                                    style={menu}
                                                                                >
                                                                                    <p className="menucontent">Share</p>
                                                                                </Menu.Item>
                                                                                <Menu.Item
                                                                                    onSelect={() => setIsShown2(true)}
                                                                                    style={menu}
                                                                                >
                                                                                    <p className="menucontent">
                                                                                        Move space
                                                                                    </p>
                                                                                </Menu.Item>
                                                                                <Menu.Item style={menu}>
                                                                                    <p className="menucontent">Duplicate</p>
                                                                                </Menu.Item>
                                                                                <Menu.Item
                                                                                    onSelect={() => setIsShown1(true)}
                                                                                    intent="danger"
                                                                                    style={menu}
                                                                                >
                                                                                    <p className="menucontentred">Delete</p>
                                                                                </Menu.Item>
                                                                            </Menu.Group>
                                                                        </Menu>
                                                                    }
                                                                >
                                                                    <MoreIcon className="more_home" style={more_home} />
                                                                </Popover>
                                                                <img src={thumb} alt="" height="35" width="35" />
                                                            </div>
                                                            <h4>{name}</h4>
                                                            <p className="deski">www.deskiapp.com</p>
                                                            <p className="des">
                                                                Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                                                                Maecenas imperdiet velit
                                                            </p>
                                                            <p className="progress">{progress}</p>
                                                            <div className="create_site">
                                                                <div style={containerStyles}>
                                                                    <div style={fillerStyles}></div>
                                                                </div>
                                                            </div>
                                                            <div className="clock">
                                                                <img src={clock} alt="" height="11" width="11" />
                                                                <p>{day}</p>
                                                            </div>
                                                            <div className="overlap">
                                                                <div>
                                                                    <img
                                                                        src={avatar}
                                                                        alt=""
                                                                        className="profiles"
                                                                        height="19"
                                                                        width="19"
                                                                    />
                                                                </div>
                                                                <div>
                                                                    <img
                                                                        src={avatar1}
                                                                        alt=""
                                                                        className="profiles"
                                                                        height="19"
                                                                        width="19"
                                                                    />
                                                                </div>
                                                                <div>
                                                                    <img
                                                                        src={avatar2}
                                                                        alt=""
                                                                        className="profiles"
                                                                        height="19"
                                                                        width="19"
                                                                    />
                                                                </div>
                                                                <div className="img_cnt">
                                                                    <p>{collaborators}</p>
                                                                </div>
                                                            </div>
                                                        </Pane>
                                                    )}
                                                </Draggable>
                                            );
                                        })}
                                        {provided.placeholder}
                                        <Link to="/new_project">
                                            <Pane className="space spc">
                                                <center>
                                                    <img
                                                        src={add_circle}
                                                        className="add_circle"
                                                        alt="add_circle"
                                                        height="22"
                                                        width="22"
                                                    />
                                                </center>
                                                <center>
                                                    <p className="add_space">Add Space</p>
                                                </center>
                                            </Pane>
                                        </Link>
                                    </div>
                                )}
                            </Droppable>
                        </DragDropContext>
                    </div>
                </Pane>

                <Pane className="workspace_container">
                    <div>
                        <h2>My Second Workspace</h2>
                        <Popover
                            position={Position.BOTTOM_LEFT}
                            minWidth={120}
                            content={
                                <Menu>
                                    <Menu.Group>
                                        <Menu.Item style={menu} icon={<Avatar src={settings} shape="square" size={10} />}>
                                            <p className="menucontent">Workspace settings</p>
                                        </Menu.Item>
                                        <Menu.Item
                                            onSelect={() => setIsShown(true)}
                                            style={menu}
                                            icon={<img src={share} alt="" height="10" width="10" />}
                                        >
                                            <p className="menucontent">Share workspace</p>
                                        </Menu.Item>
                                        <Menu.Item
                                            onSelect={() => setIsShown3(true)}
                                            style={menu}
                                            icon={<img src={rename} alt="" height="10" width="10" />}
                                        >
                                            <p className="menucontent">Rename workspace</p>
                                        </Menu.Item>
                                        <Menu.Item
                                            onClick={() => setIsShown1(true)}
                                            style={menu}
                                            icon={<img src={dlt} alt="" height="10" width="10" />}
                                        >
                                            <p className="menucontent">Delete workspace</p>
                                        </Menu.Item>
                                    </Menu.Group>
                                </Menu>
                            }
                        >
                            <img src={arrow} alt="" className="arrow" />
                        </Popover>
                        <Dialog
                            topOffset={235}
                            width={400}
                            minHeightContent={160}
                            onCloseComplete={() => setIsShown1(false)}
                            preventBodyScrolling
                            hasHeader={false}
                            isShown={isShown1}
                            hasFooter={false}
                        >
                            <div className="dlt_workspace">
                                <h4>Are you sure you want to delete this workspace ? </h4>
                                <p>Recently deleted workspaces can be restored from trash.</p>

                                <div>
                                    <button className="cancel_btn cncl" onClick={() => setIsShown1(false)}>
                                        Cancel
                                    </button>
                                    <button className="dlt_btn" onClick={() => setIsShown1(false)}>
                                        Delete workspace
                                    </button>
                                </div>
                            </div>
                        </Dialog>
                        <Dialog
                            margin="none"
                            padding="none"
                            topOffset={220}
                            width={465}
                            minHeightContent={205}
                            onCloseComplete={() => setIsShown3(false)}
                            preventBodyScrolling
                            hasHeader={false}
                            isShown={isShown3}
                            hasFooter={false}
                        >
                            <div className="rename_workspace">
                                <h4>Change App Development to</h4>
                                <p>Change your space name to another</p>
                                <TextInput
                                    marginLeft="-5px"
                                    marginRight="-20px"
                                    className="new_name"
                                    borderRadius="none"
                                    width={420}
                                    height={31}
                                    placeholder="Enter new name"
                                />
                                <div>
                                    <button className="renamecancel_btn move" onClick={() => setIsShown3(false)}>
                                        Cancel
                                    </button>
                                    <button className="move_btn" onClick={() => setIsShown3(false)}>
                                        Save
                                    </button>
                                </div>
                            </div>
                        </Dialog>
                        <Dialog
                            margin="none"
                            padding="none"
                            topOffset={220}
                            width={465}
                            minHeightContent={205}
                            onCloseComplete={() => setIsShown2(false)}
                            preventBodyScrolling
                            hasHeader={false}
                            isShown={isShown2}
                            hasFooter={false}
                        >
                            <div className="rename_workspace">
                                <h4>Move My First workplace to another workspace</h4>
                                <p>Choose workspace</p>

                                <SelectMenu
                                    height={140}
                                    width={400}
                                    title="My second workspace"
                                    options={[
                                        "My first workspace",
                                        "My second workspace",
                                        "My third workspace",
                                        "My fourth workspace",
                                    ].map((label) => ({
                                        label,
                                        value: label,
                                    }))}
                                    selected={selected1}
                                    closeOnSelect={true}
                                    hasFilter={false}
                                    hasTitle={false}
                                    onSelect={(item) => setSelected1(item.value)}
                                >
                                    <button className="dropdwn">
                                        {selected1 || "My second workspace"}
                                        <img src={arrow} className="drop_icon_pro" alt="" height="8" width="15" />
                                    </button>
                                </SelectMenu>

                                <div>
                                    <button className="cancel_btn move" onClick={() => setIsShown2(false)}>
                                        Cancel
                                    </button>
                                    <button className="move_btn" onClick={() => setIsShown2(false)} s>
                                        Move
                                    </button>
                                </div>
                            </div>
                        </Dialog>
                        <Dialog
                            margin="none"
                            padding="none"
                            topOffset={170}
                            width={465}
                            minHeightContent={305}
                            onCloseComplete={() => setIsShown(false)}
                            preventBodyScrolling
                            hasHeader={false}
                            isShown={isShown}
                            hasFooter={false}
                        >
                            <div className="share_workspace">
                                <h4>Add your teammates to deski Software</h4>
                                <p>
                                    People you add will receive an invite automatically or after your site admin has
                                    approved the request.
                                </p>
                                <TextInputField
                                    width={400}
                                    style={textinput}
                                    className="share_input"
                                    placeholder="Type name, group or email address"
                                />
                                <SelectMenu
                                    height={140}
                                    width={400}
                                    title="Select name"
                                    options={["Collaborator", "Admin", "Viewer", "Administrator"].map((label) => ({
                                        label,
                                        value: label,
                                    }))}
                                    selected={selected}
                                    closeOnSelect={true}
                                    hasFilter={false}
                                    hasTitle={false}
                                    onSelect={(item) => setSelected(item.value)}
                                >
                                    <button className="dropdown">
                                        {selected || "Administrator"}
                                        <img src={arrow} className="drop_icon" alt="" height="8" width="15" />
                                    </button>
                                </SelectMenu>

                                <div>
                                    <button className="cancel_btn" onClick={() => setIsShown(false)}>
                                        Cancel
                                    </button>
                                    <button className="add_btn" onClick={() => setIsShown(false)} s>
                                        Add
                                    </button>
                                </div>
                            </div>
                        </Dialog>
                    </div>
                    <div>
                        <DragDropContext onDragEnd={handleOnDragEnd1}>
                            <Droppable droppableId="characters" direction="horizontal">
                                {(provided) => (
                                    <div
                                        className="characters card_drag"
                                        {...provided.droppableProps}
                                        ref={provided.innerRef}
                                    >
                                        {characters1.map(({ id, name, progress, day, collaborators, thumb }, index) => {
                                            return (
                                                <Draggable key={id} draggableId={id} index={index}>
                                                    {(provided) => (
                                                        <Pane
                                                            className="space"
                                                            onClick={() => {
                                                                history.push("/board");
                                                            }}
                                                            ref={provided.innerRef}
                                                            {...provided.draggableProps}
                                                        >
                                                            <div {...provided.dragHandleProps}>
                                                                <DragHandleVerticalIcon className="card_dragicon" />
                                                                <Popover
                                                                    position={Position.BOTTOM_LEFT}
                                                                    minWidth={50}
                                                                    content={
                                                                        <Menu>
                                                                            <Menu.Group>
                                                                                <Menu.Item
                                                                                    onSelect={() => setIsShown3(true)}
                                                                                    style={menu}
                                                                                >
                                                                                    <p className="menucontent">
                                                                                        Rename space
                                                                                    </p>
                                                                                </Menu.Item>
                                                                                <Menu.Item
                                                                                    onSelect={() => setIsShown(true)}
                                                                                    style={menu}
                                                                                >
                                                                                    <p className="menucontent">Share</p>
                                                                                </Menu.Item>
                                                                                <Menu.Item
                                                                                    onSelect={() => setIsShown2(true)}
                                                                                    style={menu}
                                                                                >
                                                                                    <p className="menucontent">
                                                                                        Move space
                                                                                    </p>
                                                                                </Menu.Item>
                                                                                <Menu.Item style={menu}>
                                                                                    <p className="menucontent">Duplicate</p>
                                                                                </Menu.Item>
                                                                                <Menu.Item
                                                                                    onSelect={() => setIsShown1(true)}
                                                                                    intent="danger"
                                                                                    style={menu}
                                                                                >
                                                                                    <p className="menucontentred">Delete</p>
                                                                                </Menu.Item>
                                                                            </Menu.Group>
                                                                        </Menu>
                                                                    }
                                                                >
                                                                    <MoreIcon className="more_home" style={more_home} />
                                                                </Popover>
                                                                <img src={thumb} alt="" height="35" width="35" />
                                                            </div>
                                                            <h4>{name}</h4>
                                                            <p className="deski">www.deskiapp.com</p>
                                                            <p className="des">
                                                                Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                                                                Maecenas imperdiet velit
                                                            </p>
                                                            <p className="progress">{progress}</p>
                                                            <div className="create_site">
                                                                <div style={containerStyles}>
                                                                    <div style={fillerStyles}></div>
                                                                </div>
                                                            </div>
                                                            <div className="clock">
                                                                <img src={clock} alt="" height="11" width="11" />
                                                                <p>{day}</p>
                                                            </div>
                                                            <div className="overlap">
                                                                <div>
                                                                    <img
                                                                        src={avatar}
                                                                        alt=""
                                                                        className="profiles"
                                                                        height="19"
                                                                        width="19"
                                                                    />
                                                                </div>
                                                                <div>
                                                                    <img
                                                                        src={avatar1}
                                                                        alt=""
                                                                        className="profiles"
                                                                        height="19"
                                                                        width="19"
                                                                    />
                                                                </div>
                                                                <div>
                                                                    <img
                                                                        src={avatar2}
                                                                        alt=""
                                                                        className="profiles"
                                                                        height="19"
                                                                        width="19"
                                                                    />
                                                                </div>
                                                                <div className="img_cnt">
                                                                    <p>{collaborators}</p>
                                                                </div>
                                                            </div>
                                                        </Pane>
                                                    )}
                                                </Draggable>
                                            );
                                        })}
                                        {provided.placeholder}
                                        <Link to="/new_project">
                                            <Pane className="space spc">
                                                <center>
                                                    <img
                                                        src={add_circle}
                                                        className="add_circle"
                                                        alt="add_circle"
                                                        height="22"
                                                        width="22"
                                                    />
                                                </center>
                                                <center>
                                                    <p className="add_space">Add Space</p>
                                                </center>
                                            </Pane>
                                        </Link>
                                    </div>
                                )}
                            </Droppable>
                        </DragDropContext>
                    </div>
                </Pane>

                <Pane className="add_workspace" onClick={() => setSelectedTab(true)}>
                    <img src={add} alt="" height="15" width="15" />
                    <p>Add Workspace</p>
                </Pane>
                {selectedTab && (
                    <div className="addworkspace_field">
                        <TextInput width={220} height={40} autoFocus className="addworkspace_field_" />
                        <br></br>
                        <div>
                            <button>
                                <TickIcon className="icon" size={12} />
                            </button>
                            <button onClick={() => setSelectedTab(false)}>
                                <CrossIcon className="icon" size={12} />
                            </button>
                        </div>
                    </div>
                )}
            </div>
        </div>
    );
}

export default Workplace;
